var express = require('express');
var router = express.Router();

router.get('/', function (req, res) {
    var chains = [];
    var chainMock = {};
    chainMock.type = "image";
    chainMock.value = "data:image/png;base64,";
    chains.push(chainMock);
    res.send(chains);
});

router.get('/:chainId', function (req, res) {
    var chainMock = {};
    chainMock.type = "image";
    chainMock.value = "data:image/png;base64,";
    res.send(chainMock);
});

module.exports = router;
